import { Link, redirect } from 'react-router-dom';
import { setToken } from '../../utils/token';
import './styles.scss';

const logout = () => {
  console.log("---------");
  console.log("Hola");
  console.log("---------");

  setToken(null);
  redirect('/login');
}

function Header() {
  return (
    <div className="comp-header">
      <Link to="/">
        <img src="/assets/library.png" alt="logo"/>
      </Link>

      <div onClick={logout}>
        <img src="/assets/logout.png" alt="logout"/>
      </div>
    </div>
  );
}

export default Header;
